import { Route, Routes } from "react-router-dom";
import Welcome from "./components/Welcome";
import Product from "./components/Product";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/welcome" element={<Welcome />}></Route>
        <Route path="/product"></Route>
      </Routes>
    </div>
  );
}

export default App;
